void sys_tick_handler(void) {
	currentFrame++;
	currentFrame %= frames;
}

void clockSetup() {
	rcc_clock_setup_pll(&rcc_hse_configs[RCC_CLOCK_HSE8_72MHZ]);
  	rcc_periph_clock_enable(RCC_GPIOB);
  	rcc_periph_clock_enable(RCC_AFIO);
  	rcc_periph_clock_enable(RCC_I2C1);
	rcc_periph_clock_enable(RCC_GPIOC);
	rcc_periph_clock_enable(RCC_DMA1);
	systick_set_clocksource(STK_CSR_CLKSOURCE_AHB_DIV8);
	systick_set_reload(9000 * frameDurationMS);
	systick_interrupt_enable();
	systick_counter_enable();
}

void applyScreenMask(int frame) {
	for (int i = 0; i < BUFFERLENGTH; i++) {
		screenBuffer[i] ^= screenMasksFrameByFrame[i + BUFFERLENGTH * frame] & ((uint8_t) rand());
	}
}

static void button_setup(void) {
	gpio_set_mode(GPIOC, GPIO_MODE_INPUT, GPIO_CNF_INPUT_PULL_UPDOWN, GPIO13);
	gpio_set(GPIOC, GPIO13);
}

int main() {
	clockSetup();
	button_setup();
	i2c_init();
	for (int i = 0; i < BUFFERLENGTH; i++) {
		screenBuffer[i] = rand();
	}
	ssd1306_init(128, 64);

	ssd1306_clear(BUFFERLENGTH);
	ssd1306_start();
	ssd1306_send(DATAONLY);
	
	DATA[0] = 0xFF;
    DATA[1] = 0xFF;
    DATA[2] = 0xFF;
    DATA[3] = 0xFF;
    DATA[4] = 0xFF;
    DATA[5] = 0xFF;
    DATA[6] = 0xFF;
    DATA[7] = 0xFF;
	dma_set_memory_address(DMA1, DMA_CHANNEL6, (uint32_t) DATA);
    dma_set_number_of_data(DMA1, DMA_CHANNEL6, 8);
    dma_enable_channel(DMA1, DMA_CHANNEL6);
    while ( NOT_SET(I2C_SR1(I2C1), I2C_SR1_BTF) ); // hangs with TxE flag
    dma_clear_interrupt_flags(DMA1, DMA_CHANNEL6, DMA_IFCR_CTCIF1);
	ssd1306_stop();

	return 0;
}